import React from 'react';
import './Footer.scss';

const Footer = () => {
    return (
        <footer className="App-footer">
        <div class="container"> 
          <p>Made with enthusiasm by Catherine French in Toronto, Canada</p>
        </div>
      </footer>
    )
};

export default Footer;
